#pc-footer-wrap {
	width: 100%;
	// background-color: #0c0d19;
	margin: auto;
	// color: #4e526c;
	overflow: hidden;

	.footer-content-container {
		max-width: 1120px;
		margin-inline: auto;

		.content-wrap {
			display: flex;
			padding: 20px 0px;
			height: 100%;
			width: 100%;
			align-items: center;

			.logo-wrap {
				display: flex;
				align-items: center;
			}

			// justify-content: space-between;
			.link-wrapper {

				margin-left: auto;
				text-align: right;
				font-size: 14px;
				color: #727391;
			}

			.link {
				display: flex;
				gap: 20px;
				margin-top: 16px;

				a {
					display: flex;

					img {
						width: 28px;
						height: 28px;
					}
				}
			}

			.mail {
				display: flex;
				align-items: center;
				gap: 4px;
				margin-top: 8px;
			}

			.copyright {
				margin-left: 32px;
				color: #727391;
			}


			.copyright {
				// width: 25%;

				.site {

					font-size: 16px;
					font-style: normal;
					font-weight: 300;
					color: #CBCCD6;
				}

				.site-subinfo p {

					font-size: 11.2px;
					font-style: normal;
					font-weight: 400;
					color: #57586C;
				}
			}
		}

		.bank {
			display: flex;
			width: 100%;
			gap: 5px;
			font-size: 14px;
			color: white;
			text-transform: uppercase;
			align-items: center;
			padding: 24px 0;
			text-decoration: underline;
			flex-wrap: wrap;
			justify-content: center;

			img {
				width: 50px;
				height: 40px;
			}

			.privacy {
				display: flex;
				gap: 24px;
			}

			svg {
				// &:first-child {
				// 	margin-left: auto;
				// }
			}

			&-company {
				margin-left: auto;
				display: flex;
				gap: 24px;
			}
		}

		.agreement {
			// display: flex;
			// gap: 45px;

			p {

				font-size: 14px;
				font-style: normal;
				font-weight: 400;
				color: #8386A5;
				border-bottom: 1px solid #21243D;
				cursor: default;
			}
		}

	}

	@media screen and (max-width: 768px) {
		.content-wrap {
			flex-direction: column;
			align-items: normal !important;

			.link {
				justify-content: center !important;
			}
		}

		.logo-wrap {
			justify-content: space-between !important;
		}

		.bank {
			gap: 24px !important;

			&-company {
				flex-wrap: wrap;
				justify-content: center;
				margin-left: 0 !important;
			}


		}

		.link-wrapper {
			justify-content: center;
			margin-left: 0 !important;
			text-align: center !important;
			margin-top: 24px;
		}
	}
}
